"""
2. Отсортируйте по возрастанию методом слияния одномерный вещественный массив,
заданный случайными числами на промежутке [0; 50). Выведите на экран исходный
и отсортированный массивы.

Хотя в примерах к уроку уже есть вариант реализации слияния,
попробуйте предложить другой (придумать или найти).

И попытаться сделать замеры на массивах разной длины: 10, 100, 1000, ...

Пример:
Введите число элементов: 5
Исходный - [46.11436617832828, 41.62921998361278, 18.45859540989644, 12.128870723745806, 8.025098788570562]
Отсортированный - [8.025098788570562, 12.128870723745806, 18.45859540989644, 41.62921998361278, 46.11436617832828]
"""
import timeit
import random

# вариант сортировки без рекурсии
def Merge_Sort(a):
    def Merge_Group(a, left, m, right):
        if left >= right:
            return None
        if m < left or right < m:
            return None
        t = left
        for j in range(m + 1, right + 1):  # подгруппа 2
            for i in range(t, j):  # цикл подгруппы 1
                if a[j] < a[i]:
                    r = a[j]
                    # итерационно переставляем элементы, чтобы упорядочить
                    for k in range(j, i, -1):
                        a[k] = a[k - 1]
                    a[i] = r
                    t = i  # продолжение вставки в группе 1
                    break  # к следующему узлу из подгруппы 2

    if len(a) < 2:
        return None
    k = 1
    while k < len(a):
        g = 0
        while g < len(a):  # группы
            z = g + k + k - 1  # последний эл-т группы
            r = z if z < len(a) else len(a) - 1  # последняя группа
            Merge_Group(a, g, g + k - 1, r)  # слияние
            g += 2 * k
        k *= 2
    return a

num = int(input('Введите число элементов: '))
orig_list = [random.uniform(-100, 100) for _ in range(num)]

print(orig_list)
print(Merge_Sort(orig_list[:]))

# замеры по введенному num
print(
    timeit.timeit(
        "Merge_Sort(orig_list[:])",
        globals=globals(),
        number=1000))

# замеры 100
orig_list = [random.uniform(-100, 100) for _ in range(100)]
print('замеры для 100 элементов')
print(orig_list)
print(Merge_Sort(orig_list[:]))
print(
    timeit.timeit(
        "Merge_Sort(orig_list[:])",
        globals=globals(),
        number=1000))

# замеры 1000
orig_list = [random.uniform(-100, 100) for _ in range(1000)]
print('замеры для 1000 элементов')
print(orig_list)
print(Merge_Sort(orig_list[:]))

print(
    timeit.timeit(
        "Merge_Sort(orig_list[:])",
        globals=globals(),
        number=1000))

